import React from "react";

const AllAnimals = ({ animals }) => (
    <div>
        <ul>
            {animals.map(animal => (
                <li key={animal.id}>
                    <div role="button" className="AllAnimals__animal-link">
                        {animal.name}
                    </div>
                </li>
            ))}
        </ul>
    </div>
);

export default AllAnimals;
